import './TodoCounter.css';
const estilosTodoCounter = {
  backgroundColor: 'red'
}

function TodoCounter({ total, completed }) {
  return (
    < >
      <h1>Task</h1>
      <p>{total} / {completed}</p>
    </>
  );
}

export { TodoCounter };
